describe("RSA-PSS Vectors", () => {
    vectors.forEach(vector => {
        context(`${vector.algorithm.name} h:${vector.algorithm.hash} n:${vector.algorithm.modulusLength} e:${vector.algorithm.publicExponent}`, () => {
            for (let i in vector.signature) {
                let signature = vector.signature[i];
                let saltLength = signature.algorithm.saltLength;
                it(`s:${saltLength}`, done => {
                    let pubJwk = {
                        alg: vector.jwk.alg,
                        e: vector.jwk.e,
                        n: vector.jwk.n,
                        kty: vector.jwk.kty,
                    }
                    subtle.importKey("jwk", pubJwk, {name: vector.algorithm.name, hash: vector.algorithm.hash}, true, ["verify"])
                    .then(key => {
                        return subtle.verify(
                            signature.algorithm,
                            key,
                            new Buffer(signature.signature, "base64"),
                            MSG
                        )
                            .then(res => {
                                assert.equal(res, true);
                            })
                            .then(done, done);
                    });
                });
            }
        });
    });
});